CREATE TABLE `usersunstop`.`users` (`id` INT(11) NOT NULL AUTO_INCREMENT , `unique _id` INT(50) NULL DEFAULT NULL , `fname` VARCHAR(255) NULL DEFAULT NULL , `lname` VARCHAR(255) NULL DEFAULT NULL , `email` VARCHAR(255) NULL DEFAULT NULL , `number` INT(20) NULL DEFAULT NULL , `time` INT(6) NOT NULL DEFAULT CURRENT_TIMESTAMP , PRIMARY KEY (`id`)) ENGINE = InnoDB;